import "../style/page/login.css";
import Modal from "../Component/modal/Modal";

function Login() {
    return (
        <>
            <div id="backgroundLogin"/>
            <div id="div__containerLogin">
                <Modal />
            </div>
        </>
    );
}

export default Login;
